import React from 'react'

const TodosList = ({todos, setTodos}) => {

    const handleDelete = ({id}) => {
        setTodos(todos.filter((todo) => todo.id !== id))
    }
    return (
        <div>
            {todos.map((todo) => (
                <li 
                className = "list-item"
                key = {todo.id}>
                    <input 
                    type="text"
                    value = {todo.title}
                    onChange = {(e) => e.preventDefault()}
                    />
                <div>
                    <button>
                        Completed
                    </button>
                    <button>
                        Edit
                    </button>
                    <button
                    onClick = {() => handleDelete(todo)}
                    >
                        Deleted
                    </button>
                </div>
                </li>
            )
            )}
        </div>
    )
}

export default TodosList;
